(29,	151,	'La idea que se va  ejecutar es  organizar en una base de datos toda la información correspondiente a los diferentes hoteles que maneja la empresa para alojamiento en diferentes ciudades del pais, para ello se reunió con Camilo el dia 6 de agosto, el le pi',	'La idea tambien es cuando se activen los vuelos, agregar tambien la información de las aerolineas.',	1,	'2020-08-10 20:50:28',	'2020-08-10 20:50:28',	'2020-09-10'),
