(40,	148,	'La empleada manifiesta que en ocasiones se siente enredada con la metodología, pero que en general se ha sentido bien con el manejo del grupo.',	'Se le recomienda que utilice estrategias diferentes para aplicar la metodologia con el fin de que todas las personas trabajen alrededor del reto. Se necesita ir mas alla de lo que nos entregan.',	1,	'2020-09-02 19:32:01',	'2020-09-02 19:32:01',	NULL),
(41,	151,	'Beatriz le envio base de datos a Camilo de hoteles, tanto de Aviatur como de otros particulares. La base de datos fue enviada por correo electrónico el 2 de septiembre de 2020. Con respecto a la base de datos de las aerolineas, aun no se ha empezado a tra',	'Beatriz ha estado hablando con Camilo al respecto pero aunque esta información ya se envio, no se ha empezado a montar. Se le sugiere a Betria que le solicite a Camilo una fecha estimada de avances del proyecto y citar para verificar esos avances.',	1,	'2020-09-11 13:36:05',	'2020-09-11 13:37:48',	'2020-09-30'),
