(95,	286,	'Beatriz hable con Camilo el dia 1 de febrero, informa que al numero antiguo ya no llaman muchas personas, Camilo informa que es mejor cancelar la linea de Tigo y  hacer las nuevas grabaciones en el telefono antiguo pero cn la nueva linea.',	'1. Asegurarse con Camilo de que cuando cancele la linea de Tigo quede el mensaje automatico sobre el cambio de número. 2. Se deben hacer las grabaciones pertinentes para el nuevo conmutador. 3. Se debe tener el guión de grabaciones.',	1,	'2021-02-02 14:37:27',	'2021-02-02 14:37:27',	'2021-02-15'),
(96,	287,	'Con respecto a este tema, se noto mejoria en el momento que se le informo que no podia seguir trabajando desde la casa. Se considera que lo asumio de buena forma y entendio la situación.',	'Se procede a cerrar este plan de mejora.',	1,	'2021-02-02 14:41:40',	'2021-02-02 14:41:40',	NULL),
(97,	287,	'Con respecto a este tema, se noto mejoria en el momento que se le informo que no podia seguir trabajando desde la casa. Se considera que lo asumio de buena forma y entendio la situación.',	'Se procede a cerrar este plan de mejora.',	1,	'2021-02-02 14:41:42',	'2021-02-02 14:41:42',	NULL),
(98,	286,	'El día lumes 15 de febrero se hace seguimiento sin embargo no se encuentra ningun avance debido a que Camilo se encuentra incapacitado.',	'Se estima retomar el tema a finales del mes de febrero, una ve Camilo vuelva de su incapacidad.',	1,	'2021-02-15 11:42:40',	'2021-02-15 11:42:40',	'2021-03-02'),
(99,	284,	'Nos reunimos Leidy, Gladys y Alejandra el dia 15 de febrero a hacer seguimiento y Leidy como lider del cargo informa que se ha notado mejoria con respecto a este tema, porque ya hay una mayor claridad desde el prinicipio de la tarea.',	'Continuar asegurandose de tener clara información de cada acción que se ejecute.',	1,	'2021-02-15 20:44:08',	'2021-02-15 20:44:08',	'2021-02-11'),
(100,	284,	'Aún se sigue prsentando la situación de enviar mensajes de voz  muy extensos cuando se podrian simplificar a través de una llamada.',	'Seguir trabajando en reducir el envio de mensajes de voz cuando son muy extensos y revisar el estado de las persons (ocupado o libre) cuando vaya a contactar a alguien y no sea de forma urgente',	1,	'2021-02-15 20:51:28',	'2021-02-15 20:51:28',	'2021-03-10'),
(101,	285,	'Se realizo verificación del procedimiento y se hacen correcciones al respecto.',	'Se define que Leidy Maldonado es la persona que aprueba todas las facturas salvo que se encuentre por fuera de la empresa, y en este caso seria Gladys la persona autorizada.',	1,	'2021-02-15 20:56:08',	'2021-02-15 20:56:08',	NULL),
(102,	258,	'Ya se nota mas liderazgo en el manejo de los comites y poco a poco empoderamiento en la realizació de informes.',	'Se recomienda proponer mas ideas en el area de SST que no sea solo ejecucipon si no tambien propuestas nuevas.',	1,	'2021-02-15 21:06:58',	'2021-02-15 21:06:58',	'2021-03-10'),
