(8,	1,	'f8e3f74f467ebe8b5b59395235068c02',	'chartbar',	'area5',	0,	NULL,	'{\"name\":\"Promedio de general por competencia\",\"sql\":\"SELECT \\r\\nc.competencia AS \'label\', \\r\\nROUND(AVG(pv.puntuacion)*7,1) AS \'value\'\\r\\n FROM \\r\\npuntuacion_valoracion AS pv\\r\\nINNER JOIN competencia AS c ON pv.competencia_id = c.id\\r\\nINNER JOIN comportamiento AS co ON co.id = pv.comportamiento_id\\r\\nINNER JOIN valoracion AS v ON pv.valoracion_id = v.id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nWHERE\\r\\nv.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\'))\\r\\nGROUP BY c.competencia\",\"area_name\":\"Competencias\",\"goals\":\"100\"}',	'2019-07-17 04:23:40',	NULL),
(9,	2,	'58b6dff3f9c4910763bbb9586a53a0a8',	'smallbox',	'area1',	1,	NULL,	'{\"name\":\"Mi Equipo\",\"icon\":\"ion-bag\",\"color\":\"bg-green\",\"link\":\"\\/motoborda\\/admin\\/cms_users20?m=46\",\"sql\":\"SELECT \\r\\ncount(u.id)\\r\\n FROM \\r\\norden_cargos AS c\\r\\nINNER JOIN cms_users AS u ON c.cargo_id = u.cargoid\\r\\nWHERE c.lider_id = (SELECT us.cargoid FROM cms_users AS us WHERE us.id =  [admin_id])\"}',	'2019-08-13 07:03:55',	NULL),
(10,	2,	'090e9b48535f1513b856c192c181b820',	'smallbox',	'area2',	1,	NULL,	'{\"name\":\"Auto -Evaluaciones\",\"icon\":\"ion-bag\",\"color\":\"bg-aqua\",\"link\":\"\\/motoborda\\/autoevaluaciones?m=34\",\"sql\":\"SELECT \\r\\nCOUNT(u.id) - COUNT(ae.user_id)\\r\\n FROM \\r\\norden_cargos AS c\\r\\nINNER JOIN cms_users AS u ON c.cargo_id = u.cargoid\\r\\nLEFT JOIN autoevaluacion AS ae ON u.id = ae.user_id\\r\\nWHERE c.lider_id = (SELECT us.cargoid FROM cms_users AS us WHERE us.id =  [admin_id])\"}',	'2019-08-13 07:23:18',	NULL),
(11,	2,	'a97c97044c50a3251a1123d0595e46a8',	'smallbox',	'area3',	0,	NULL,	'{\"name\":\"Evaluciones consolidadas\",\"icon\":\"ion-bag\",\"color\":\"bg-yellow\",\"link\":\"\\/\",\"sql\":\"SELECT\\r\\nCOUNT(u.id)- COUNT(ae.user_id)\\r\\n FROM \\r\\norden_cargos AS c\\r\\nINNER JOIN cms_users AS u ON c.cargo_id = u.cargoid\\r\\nLEFT JOIN autoevaluacion_coordinador AS ae ON u.id = ae.user_id\\r\\nWHERE c.lider_id = (SELECT us.cargoid FROM cms_users AS us WHERE us.id =  [admin_id])\"}',	'2019-08-13 07:38:51',	NULL),
(17,	3,	'5c97f84b60e2b29d5821eb2c33d5072e',	'table',	'area5',	0,	NULL,	'{\"name\":\"Competencias\",\"sql\":\"SELECT \\r\\ncvw.competencia as \'Competencia\',\\r\\ncvw.comportamiento AS \'Comportamiento\',\\r\\nsum(cvw.puntos) as \'Puntos\'\\r\\n FROM competencias_view AS cvw\\r\\n WHERE \\r\\n cvw.usuarios = (SELECT us.cargoid FROM cms_users AS us WHERE us.id = [admin_id])\\r\\n GROUP BY cvw.comportamiento\\r\\nORDER BY cvw.competencia\"}',	'2019-08-13 12:16:01',	NULL),
(18,	3,	'fc4d72a60638eaa451dd9c02327696cd',	'smallbox',	'area1',	0,	NULL,	'{\"name\":\"Promedio innovaci\\u00f3n\",\"icon\":\"ion-bag\",\"color\":\"bg-green\",\"link\":\"\\/\",\"sql\":\"SELECT\\r\\nIFNULL(CONCAT(ROUND(SUM(CASE WHEN (pv.competencia_id = 3) OR  (pv.competencia_id = 6) THEN  pv.puntuacion ELSE 0 END ) * 17 \\/ 25, 1),\'%\'),\'Sin Informaci\\u00f3n\')\\r\\nFROM \\r\\nvaloracion AS v\\r\\nINNER JOIN puntuacion_valoracion AS pv ON v.id = pv.valoracion_id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nWHERE\\r\\nu.id =[admin_id]\\r\\nAND DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND v.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\') AND v.user_id = [admin_id])\"}',	'2019-08-13 12:22:01',	NULL),
(19,	3,	'548c923ce28c6a8c6f975e017d1172db',	'smallbox',	'area2',	0,	NULL,	'{\"name\":\"Promedio liderazgo\",\"icon\":\"ion-bag\",\"color\":\"bg-aqua\",\"link\":\"\\/motoborda\\/lista_autoevaluaciones?m=32\",\"sql\":\"SELECT\\r\\nIFNULL(CONCAT(ROUND(SUM(CASE WHEN (pv.competencia_id = 1) OR  (pv.competencia_id = 4) THEN  pv.puntuacion ELSE 0 END ) * 17 \\/ 35, 1),\'%\'),\'Sin Informaci\\u00f3n\')\\r\\nFROM \\r\\nvaloracion AS v\\r\\nINNER JOIN puntuacion_valoracion AS pv ON v.id = pv.valoracion_id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nWHERE\\r\\nu.id =[admin_id]\\r\\nAND DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND v.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')AND v.user_id = [admin_id])\"}',	'2019-08-13 12:22:03',	NULL),
(20,	3,	'781a3203fc20eea3bdc025c8fc24ea67',	'smallbox',	'area3',	0,	NULL,	'{\"name\":\"Promedio trabajo en equipo\",\"icon\":\"ion-bag\",\"color\":\"bg-yellow\",\"link\":\"\\/motoborda\\/lista_autoevaluaciones?m=32\",\"sql\":\"SELECT\\r\\nIFNULL(CONCAT(ROUND(SUM(CASE WHEN (pv.competencia_id = 2) OR  (pv.competencia_id = 5) THEN  pv.puntuacion ELSE 0 END ) * 17 \\/ 25, 1),\'%\'),\'Sin Informaci\\u00f3n\')\\r\\nFROM \\r\\nvaloracion AS v\\r\\nINNER JOIN puntuacion_valoracion AS pv ON v.id = pv.valoracion_id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nWHERE\\r\\nu.id =[admin_id]\\r\\nAND DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND v.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')AND v.user_id = [admin_id])\"}',	'2019-08-13 12:22:05',	NULL),
(21,	1,	'3bce6b114699362e9e6e4cef1d61f984',	'chartbar',	'area5',	1,	NULL,	'{\"name\":\"Promedio de competencias por equipos de trabajo\",\"sql\":\"SELECT \\r\\nar.area AS \'label\', \\r\\nROUND(AVG(pv.puntuacion)*7,1) AS \'value\'\\r\\n FROM \\r\\npuntuacion_valoracion AS pv\\r\\nINNER JOIN competencia AS c ON pv.competencia_id = c.id\\r\\nINNER JOIN comportamiento AS co ON co.id = pv.comportamiento_id\\r\\nINNER JOIN valoracion AS v ON pv.valoracion_id = v.id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nINNER JOIN cargo AS cg ON u.cargoid = cg.id\\r\\nINNER JOIN area AS ar ON cg.area = ar.id\\r\\nWHERE\\r\\nv.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\'))\\r\\nAND \\r\\nDATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nGROUP BY ar.area\",\"area_name\":\"Equipo de trabajo\",\"goals\":\"100\"}',	'2019-08-13 14:07:31',	NULL),
(23,	2,	'1891dff1fd212ceb494335df7a5ebb59',	'table',	'area5',	4,	NULL,	'{\"name\":\"Indicadores\",\"sql\":\"SELECT \\r\\nCONCAT(u.name,\' \',u.apellido) as \'Colaborador\',\\r\\nmi.mes as \'Mes\',\\r\\nmi.desempeno as \'Valor\'\\r\\nmi.feha_creacion as \'Fecha del indicador\'\\r\\nFROM maestro_indicadores AS mi\\r\\nINNER JOIN cms_users AS u ON mi.documento = u.documento\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.cargo_id\\r\\nWHERE\\r\\noc.lider_id = 1\"}',	'2019-09-20 06:13:28',	NULL),
(25,	2,	'bb10a2fdc8a75f47d3b3047df28cfdea',	'table',	'area5',	6,	NULL,	'{\"name\":\"Desempe\\u00f1o\",\"sql\":\"SELECT \\r\\ncvw.documento AS \'Documento\',\\r\\ncvw.colaborador AS \'Colaborador\',\\r\\ncvw.cargo AS \'Cargo\', \\r\\nROUND(sum(cvw.puntos) *  50 \\/ (COUNT(cvw.puntos)*5),1) + ROUND(AVG(mi.desempeno),1) AS \'Nota Final\'\\r\\n FROM competencias_view AS cvw\\r\\n INNER JOIN maestro_indicadores AS mi ON cvw.documento = mi.documento\\r\\n WHERE \\r\\n cvw.evaluador = 4\\r\\n GROUP BY cvw.usuariocolaborador\"}',	'2019-09-20 09:25:50',	NULL),
