(35,	5,	'bc8a619a8c1d0cbebd25027f2d99f252',	'smallbox',	'area1',	0,	NULL,	'{\"name\":\"Promedio trabajo en equipo\",\"icon\":\"ion-bag\",\"color\":\"bg-green\",\"link\":\"\\/\",\"sql\":\"SELECT \\r\\nCASE\\r\\nWHEN SUM(pv.puntuacion) > 0 \\r\\nTHEN \\r\\nCONCAT(ROUND(sum(pv.puntuacion ) *50 \\/ (COUNT(pv.puntuacion)*5),1)+(SELECT IF(COUNT(mi.desempeno) = 0, 0,ROUND(AVG(mi.desempeno)*0.5,1))\\r\\nFROM \\r\\nmaestro_indicadores AS mi\\r\\nWHERE\\r\\nmi.meta = v.periodo\\r\\nAND mi.meta = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\') )\\r\\nAND DATE_FORMAT(mi.feha_creacion,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\n),\'%\')\\r\\nELSE \'Sin Informaci\\u00f3n\'\\r\\n\\r\\nEND\\r\\n\\r\\nFROM \\r\\npuntuacion_valoracion AS pv\\r\\nINNER JOIN competencia AS c ON pv.competencia_id = c.id\\r\\nINNER JOIN comportamiento AS co ON co.id = pv.comportamiento_id\\r\\nINNER JOIN valoracion AS v ON pv.valoracion_id = v.id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.lider_id\\r\\nWHERE\\r\\nv.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\'))\\r\\nAND \\r\\nDATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND c.id = 2\\r\\nAND u.id = [admin_id]\"}',	'2019-09-20 10:06:16',	NULL),
(36,	5,	'e785c55f58237c771537bd37ce5761a9',	'smallbox',	'area2',	0,	NULL,	'{\"name\":\"Promedio liderazgo\",\"icon\":\"ion-bag\",\"color\":\"bg-red\",\"link\":\"\\/\",\"sql\":\"SELECT \\r\\nCASE\\r\\nWHEN SUM(pv.puntuacion) > 0 \\r\\nTHEN \\r\\nCONCAT(ROUND(sum(pv.puntuacion ) *50 \\/ (COUNT(pv.puntuacion)*5),1)+(SELECT IF(COUNT(mi.desempeno) = 0, 0,ROUND(AVG(mi.desempeno)*0.5,1))\\r\\nFROM \\r\\nmaestro_indicadores AS mi\\r\\nWHERE\\r\\nmi.meta = v.periodo\\r\\nAND mi.meta = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\') )\\r\\nAND DATE_FORMAT(mi.feha_creacion,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\n),\'%\')\\r\\nELSE \'Sin Informaci\\u00f3n\'\\r\\n\\r\\nEND\\r\\n\\r\\nFROM \\r\\npuntuacion_valoracion AS pv\\r\\nINNER JOIN competencia AS c ON pv.competencia_id = c.id\\r\\nINNER JOIN comportamiento AS co ON co.id = pv.comportamiento_id\\r\\nINNER JOIN valoracion AS v ON pv.valoracion_id = v.id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.lider_id\\r\\nWHERE\\r\\nv.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\'))\\r\\nAND \\r\\nDATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND c.id = 1\\r\\nAND u.id = [admin_id]\"}',	'2019-09-20 10:06:18',	NULL),
(37,	5,	'e4992627bae85b51ada8c4e53ce1521b',	'smallbox',	'area3',	0,	NULL,	'{\"name\":\"Promedio innovaci\\u00f3n\",\"icon\":\"ion-bag\",\"color\":\"bg-aqua\",\"link\":\"\\/\",\"sql\":\"SELECT \\r\\nCASE\\r\\nWHEN SUM(pv.puntuacion) > 0 \\r\\nTHEN \\r\\nCONCAT(ROUND(sum(pv.puntuacion ) *50 \\/ (COUNT(pv.puntuacion)*5),1)+(SELECT IF(COUNT(mi.desempeno) = 0, 0,ROUND(AVG(mi.desempeno)*0.5,1))\\r\\nFROM \\r\\nmaestro_indicadores AS mi\\r\\nWHERE\\r\\nmi.meta = v.periodo\\r\\nAND mi.meta = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\') )\\r\\nAND DATE_FORMAT(mi.feha_creacion,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\n),\'%\')\\r\\nELSE \'Sin Informaci\\u00f3n\'\\r\\n\\r\\nEND\\r\\n\\r\\nFROM \\r\\npuntuacion_valoracion AS pv\\r\\nINNER JOIN competencia AS c ON pv.competencia_id = c.id\\r\\nINNER JOIN comportamiento AS co ON co.id = pv.comportamiento_id\\r\\nINNER JOIN valoracion AS v ON pv.valoracion_id = v.id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.lider_id\\r\\nWHERE\\r\\nv.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\'))\\r\\nAND \\r\\nDATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND c.id = 3\\r\\nAND u.id = [admin_id]\"}',	'2019-09-20 10:06:20',	NULL),
(40,	2,	'04fae5303d9fd46ad1ad13fabdce6734',	'table',	'area5',	1,	NULL,	'{\"name\":\"Indicadores\",\"sql\":\"SELECT \\\\r\\\\nCONCAT(u.name,\' \',u.apellido) as \'Colaborador\',\\\\r\\\\nmi.mes as \'Mes\',\\\\r\\\\nmi.desempeno as \'Valor\'\\\\r\\\\nmi.feha_creacion as \'Fecha del indicador\'\\\\r\\\\nFROM maestro_indicadores AS mi\\\\r\\\\nINNER JOIN cms_users AS u ON mi.documento = u.documento\\\\r\\\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.cargo_id\\\\r\\\\nWHERE\\\\r\\\\noc.lider_id = 1\"}',	'2019-09-20 13:02:17',	NULL),
(44,	7,	'f2ce4227b3b646f469edc268a1b343b0',	'chartbar',	'area5',	0,	NULL,	'{\"name\":\"Desempe\\u00f1o por equipo trabajo\",\"sql\":\"SELECT \\r\\ncvw.area AS \'label\',\\r\\nROUND((ROUND(sum(cvw.puntos) *  50 \\/ (COUNT(cvw.puntos)*5),1) + ROUND(AVG(mi.desempeno),0)) \\/2 ,1) AS \'value\'\\r\\n FROM competencias_view AS cvw\\r\\n INNER JOIN maestro_indicadores AS mi ON cvw.documento = mi.documento\\r\\n \\r\\n GROUP BY cvw.area\",\"area_name\":\"Equipo trabajo\",\"goals\":\"100\"}',	'2019-09-20 13:38:41',	NULL),
