(46,	3,	'3643369b48b29a0fa024b0a634feec1d',	'smallbox',	'area4',	0,	NULL,	'{\"name\":\"Promedio indicadores\",\"icon\":\"ion-bag\",\"color\":\"bg-aqua\",\"link\":\"\\/\",\"sql\":\"SELECT \\r\\nCASE WHEN SUM(mi.desempeno) >= 1 THEN CONCAT(ROUND(AVG(mi.desempeno)*0.49,1),\'%\') ELSE \'Sin Informaci\\u00f3n\' END,\\r\\nDATE_FORMAT(NOW(),\'%Y\'),\\r\\n(SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')AND v.user_id = [admin_id])\\r\\n\\r\\n FROM \\r\\nmaestro_indicadores AS mi\\r\\nJOIN cms_users AS u ON mi.documento = u.documento\\r\\nJOIN valoracion AS v ON u.id = v.user_id\\r\\nJOIN puntuacion_valoracion AS pv ON v.id = pv.valoracion_id\\r\\nWHERE\\r\\nu.id = [admin_id]\\r\\nAND mi.meta = v.periodo\\r\\nAND DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND v.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')AND v.user_id = [admin_id])\"}',	'2019-09-20 14:28:46',	NULL),
(49,	8,	'54b782d51023d7c6af34c36a56a9d407',	'chartbar',	'area5',	0,	NULL,	'{\"name\":\"Competencias periodo actual\",\"sql\":\"SELECT \\r\\nc.competencia as \'value\',\\r\\nSUM(pv.puntuacion ) as  \'label\'\\r\\n\\r\\n FROM \\r\\npuntuacion_valoracion AS pv\\r\\nINNER JOIN  valoracion AS v ON pv.valoracion_id = v.id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nLEFT JOIN competencia AS c ON pv.competencia_id = c.id\\r\\nWHERE\\r\\nu.acargo = \'No\'\\r\\nGROUP BY c.competencia\",\"area_name\":\"Competencias\",\"goals\":\"100\"}',	'2019-12-17 08:45:04',	NULL),
(50,	5,	'88e29f8e27d232ad4c844a38feba2f69',	'chartbar',	'area5',	3,	NULL,	'{\"name\":\"Competencias\",\"sql\":\"SELECT \\r\\nCONCAT(ROUNd(sum(pv.puntuacion ) *100 \\/ (COUNT(pv.puntuacion)*5),1),\'  %\') AS \'value\',\\r\\nc.competencia AS \'label\'\\r\\n FROM \\r\\npuntuacion_valoracion AS pv\\r\\nINNER JOIN competencia AS c ON pv.competencia_id = c.id\\r\\nINNER JOIN comportamiento AS co ON co.id = pv.comportamiento_id\\r\\nINNER JOIN valoracion AS v ON pv.valoracion_id = v.id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.lider_id\\r\\nWHERE\\r\\nDATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND \\r\\nv.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\'))\\r\\nAND u.id = [admin_id]\\r\\nGROUP BY pv.competencia_id\",\"area_name\":\"Competencias\",\"goals\":\"100\"}',	'2019-12-17 08:58:49',	NULL),
(55,	2,	'0f853ab9f1db3f445f1a4cee62c44d01',	'chartbar',	'area5',	0,	NULL,	'{\"name\":\"Competencias\",\"sql\":\"SELECT \\r\\nCONCAT(ROUNd(sum(pv.puntuacion ) *17\\/ (COUNT(pv.puntuacion)*5),1),\'  %\') AS \'value\',\\r\\nc.competencia AS \'label\'\\r\\n FROM \\r\\npuntuacion_valoracion AS pv\\r\\nINNER JOIN competencia AS c ON pv.competencia_id = c.id\\r\\nINNER JOIN comportamiento AS co ON co.id = pv.comportamiento_id\\r\\nINNER JOIN valoracion AS v ON pv.valoracion_id = v.id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.cargo_id\\r\\nWHERE\\r\\nDATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND \\r\\nv.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\'))\\r\\nAND oc.lider_id =[admin_cargoid]\\r\\nGROUP BY pv.competencia_id\",\"area_name\":\"Competencias\",\"goals\":\"100\"}',	'2020-03-11 18:02:15',	NULL),
(56,	2,	'a921f9ab835d5853632fd65c17550551',	'smallbox',	'area3',	1,	NULL,	'{\"name\":\"Promedio liderazgo\",\"icon\":\"ion-bag\",\"color\":\"bg-red\",\"link\":\"\\/\",\"sql\":\"SELECT \\r\\nCASE\\r\\nWHEN SUM(pv.puntuacion) > 0 \\r\\nTHEN \\r\\nCONCAT(ROUND(sum(pv.puntuacion ) *17 \\/ (COUNT(pv.puntuacion)*5),1),\'%\')\\r\\nELSE \'Sin Informaci\\u00f3n\'\\r\\nEND\\r\\nFROM \\r\\npuntuacion_valoracion AS pv\\r\\nINNER JOIN competencia AS c ON pv.competencia_id = c.id\\r\\nINNER JOIN comportamiento AS co ON co.id = pv.comportamiento_id\\r\\nINNER JOIN valoracion AS v ON pv.valoracion_id = v.id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.cargo_id\\r\\nWHERE\\r\\nv.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\'))\\r\\nAND \\r\\nDATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND c.id  IN(1,4)\\r\\nAND oc.lider_id =[admin_cargoid]\"}',	'2020-03-11 18:04:38',	NULL),
(59,	2,	'a30d644dbbe9fc57ed71f83d0befff19',	'smallbox',	'area2',	1,	NULL,	'{\"name\":\"Promedio trabajo en equipo\",\"icon\":\"ion-bag\",\"color\":\"bg-green\",\"link\":\"\\/\",\"sql\":\"SELECT \\r\\nCASE\\r\\nWHEN SUM(pv.puntuacion) > 0 \\r\\nTHEN \\r\\nCONCAT(ROUND(sum(pv.puntuacion ) *17 \\/ (COUNT(pv.puntuacion)*5),1),\'%\')\\r\\nELSE \'Sin Informaci\\u00f3n\'\\r\\nEND\\r\\nFROM \\r\\npuntuacion_valoracion AS pv\\r\\nINNER JOIN competencia AS c ON pv.competencia_id = c.id\\r\\nINNER JOIN comportamiento AS co ON co.id = pv.comportamiento_id\\r\\nINNER JOIN valoracion AS v ON pv.valoracion_id = v.id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.cargo_id\\r\\nWHERE\\r\\nv.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\'))\\r\\nAND \\r\\nDATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND c.id IN (2,5)\\r\\nAND oc.lider_id =[admin_cargoid]\"}',	'2020-03-11 18:05:34',	NULL),
(60,	2,	'120aad0c9f47d77e46a1b02a1d43c5b6',	'smallbox',	'area1',	1,	NULL,	'{\"name\":\"Promedio innovaci\\u00f3n\",\"icon\":\"ion-bag\",\"color\":\"bg-aqua\",\"link\":\"\\/\",\"sql\":\"SELECT \\r\\nCASE\\r\\nWHEN SUM(pv.puntuacion) > 0 \\r\\nTHEN \\r\\nCONCAT(ROUND(sum(pv.puntuacion )*17\\/ (COUNT(pv.puntuacion)*5),1),\'%\')\\r\\nELSE \'Sin Informaci\\u00f3n\'\\r\\nEND\\r\\nFROM \\r\\npuntuacion_valoracion AS pv\\r\\nINNER JOIN competencia AS c ON pv.competencia_id = c.id\\r\\nINNER JOIN comportamiento AS co ON co.id = pv.comportamiento_id\\r\\nINNER JOIN valoracion AS v ON pv.valoracion_id = v.id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.cargo_id\\r\\nWHERE\\r\\nv.periodo = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\'))\\r\\nAND \\r\\nDATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND c.id IN(3,6)\\r\\nAND oc.lider_id =[admin_cargoid]\"}',	'2020-03-11 18:09:06',	NULL),
(61,	2,	'35792ca3dacde12e6591a348a0487e87',	'smallbox',	'area4',	0,	NULL,	'{\"name\":\"Permisos pendientes por revisar\",\"icon\":\"ion-bag\",\"color\":\"bg-red\",\"link\":\"\\/\",\"sql\":\"SELECT \\r\\nCOUNT(ps.user_id) FROM \\r\\npermiso_salida AS ps\\r\\nINNER JOIN cms_users AS u ON ps.user_id = u.id\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.cargo_id\\r\\nWHERE\\r\\nps.autorizado = \'pendiente\'\\r\\nAND\\r\\noc.lider_id = [admin_cargoid]\"}',	'2020-03-11 18:24:36',	NULL),
(62,	2,	'c06620890fdaccbd4417251fd1466e16',	'smallbox',	'area4',	1,	NULL,	'{\"name\":\"Promedio indicadores\",\"icon\":\"ion-bag\",\"color\":\"bg-yellow\",\"link\":\"\\/\",\"sql\":\"SELECT \\r\\nCASE\\r\\nWHEN ROUND(AVG(mi.desempeno),1) > 0\\r\\nTHEN ROUND(AVG(mi.desempeno),1)\\r\\nELSE \'Sin Informaci\\u00f3n\'\\r\\nEND\\r\\n FROM \\r\\nmaestro_indicadores AS mi\\r\\nINNER JOIN cms_users AS u ON u.documento = mi.documento\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.cargo_id\\r\\nWHERE \\r\\noc.lider_id = [admin_cargoid]\\r\\nAND DATE_FORMAT(mi.feha_creacion,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND mi.meta = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\') )\"}',	'2020-03-11 18:41:46',	NULL),
(63,	5,	'8b0a31ca78d4e62d9be3013256dfca9a',	'smallbox',	'area4',	0,	NULL,	'{\"name\":\"Promedio indicadores\",\"icon\":\"ion-bag\",\"color\":\"bg-yellow\",\"link\":\"\\/\",\"sql\":\"SELECT \\r\\nCASE\\r\\nWHEN ROUND(AVG(mi.desempeno),1) > 0\\r\\nTHEN ROUND(AVG(mi.desempeno),1)\\r\\nELSE \'Sin Informaci\\u00f3n\'\\r\\nEND\\r\\n FROM \\r\\nmaestro_indicadores AS mi\\r\\nINNER JOIN cms_users AS u ON u.documento = mi.documento\\r\\nINNER JOIN orden_cargos AS oc ON u.cargoid = oc.cargo_id\\r\\nWHERE \\r\\noc.lider_id = [admin_cargoid]\\r\\nAND DATE_FORMAT(mi.feha_creacion,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\')\\r\\nAND mi.meta = (SELECT MAX(v.periodo)  FROM  valoracion AS v  WHERE  DATE_FORMAT(v.created_at,\\\"%Y\\\") = DATE_FORMAT(NOW(),\'%Y\') )\"}',	'2020-03-11 18:55:45',	NULL),
(66,	3,	'ce8dcdf1431c815e359580979879cf56',	'table',	'area5',	0,	NULL,	'{\"name\":\"Hist\\u00f3rico de Evaluaciones\",\"sql\":\"SELECT\\r\\nv.periodo AS \'Ciclo\',\\r\\nDATE_FORMAT(v.created_at, \'%d - %m - %Y\') AS \'Fecha de aplicaci\\u00f3n\',\\r\\nIFNULL((\\r\\nSELECT CONCAT(ROUND(AVG(mi.desempeno)*0.49,1),\'%\') \\r\\nFROM \\r\\nmaestro_indicadores AS mi\\r\\nWHERE\\r\\nmi.documento = u.documento\\r\\nAND mi.meta = v.periodo\\r\\nGROUP BY mi.meta\\r\\n ),\'0 %\')AS \'Cumplimiento de Indicadores \',\\r\\n\\r\\nCONCAT(ROUND(SUM(CASE WHEN (pv.competencia_id = 1) OR  (pv.competencia_id = 4) THEN  pv.puntuacion ELSE 0 END ) * 17 \\/ 35, 1),\'%\') AS \'Liderago\',\\r\\nCONCAT(ROUND(SUM(CASE WHEN (pv.competencia_id = 2) OR  (pv.competencia_id = 5)  THEN  pv.puntuacion ELSE 0 END ) * 17 \\/ 25, 1),\'%\') \'Trabajo en Equipo\',\\r\\nCONCAT(ROUND(SUM(CASE WHEN (pv.competencia_id = 3) OR  (pv.competencia_id = 6)  THEN  pv.puntuacion ELSE 0 END )* 17 \\/ 25, 1),\'%\') AS \'Innovaci\\u00f3n\', \\r\\n \\r\\nCONCAT(ROUND(\\r\\nSUM(CASE WHEN (pv.competencia_id = 1) OR  (pv.competencia_id = 4)  THEN  pv.puntuacion ELSE 0 END ) * 17 \\/ 35 +\\r\\nSUM(CASE WHEN (pv.competencia_id = 2 ) OR  (pv.competencia_id = 5) THEN  pv.puntuacion ELSE 0 END ) * 17 \\/ 25 +\\r\\nSUM(CASE WHEN (pv.competencia_id = 3 ) OR  (pv.competencia_id = 6) THEN  pv.puntuacion ELSE 0 END )* 17 \\/ 25 + \\r\\n\\r\\nIFNULL((\\r\\nSELECT ROUND(AVG(mi.desempeno)*0.49,1) \\r\\nFROM \\r\\nmaestro_indicadores AS mi\\r\\nWHERE\\r\\nmi.documento = u.documento\\r\\nAND mi.meta = v.periodo\\r\\nGROUP BY mi.meta\\r\\n ),0)\\r\\n \\r\\n , 1),\'%\') AS \'Cumplimiento total\'\\r\\n\\r\\n\\r\\nFROM \\r\\nvaloracion AS v\\r\\nINNER JOIN puntuacion_valoracion AS pv ON v.id = pv.valoracion_id\\r\\nINNER JOIN cms_users AS u ON v.user_id = u.id\\r\\n\\r\\nWHERE\\r\\nu.id =  [admin_id]\\r\\n\\r\\nGROUP BY pv.valoracion_id, u.id\"}',	'2020-04-02 00:26:49',	NULL),
