INSERT INTO `competencia` (`id`, `competencia`, `descripcion`, `valor`, `acargo`) VALUES
(1,	'Liderazgo',	'Capacidad para generar compromiso y lograr el respaldo de sus superiores con vista a enfrentar con éxito los desafíos de la organización. Capacidad para asegurar una adecuada conducción de personas, desarrollar el talento, lograr y mantener un clima organizacional, armónico y desafiante.',	17,	0),
(2,	'Trabajo en Equipo',	'Capacidad para colaborar con los demás, formar parte de un grupo y trabajar con otras áreas de la organización, con el propósito de alcanzar, en conjunto, la estrategia organizacional, subordinar los intereses personales a los objetivos grupales. Implica tener expectativas positivas respecto a los demás, comprender a los otros, y generar y mantener un buen clima de trabajo.',	17,	0),
(3,	'Innovación',	'Capacidad para idear soluciones nuevas y diferentes dirigidas a resolver problemas o mejorar situaciones que se presenten bien sea en el puesto de trabajo o en  la organización en general.',	17,	0),
(4,	'Liderazgo',	'Capacidad para generar compromiso y lograr el respaldo de sus superiores con vista a enfrentar con éxito los desafíos de la organización. Capacidad para asegurar una adecuada conducción de personas, desarrollar el talento, lograr y mantener un clima organizacional, armónico y desafiante.',	17,	1),
(5,	'Trabajo en Equipo',	'Capacidad para colaborar con los demás, formar parte de un grupo y trabajar con otras áreas de la organización, con el propósito de alcanzar, en conjunto, la estrategia organizacional, subordinar los intereses personales a los objetivos grupales. Implica tener expectativas positivas respecto a los demás, comprender a los otros, y generar y mantener un buen clima de trabajo.',	17,	1),
(6,	'Innovación',	'Capacidad para idear soluciones nuevas y diferentes dirigidas a resolver problemas o mejorar situaciones que se presenten bien sea en el puesto de trabajo o en  la organización en general.',	17,	1);
