INSERT INTO `comportamiento_360` (`id`, `p_acargo`, `id_competencia`, `nombre`) VALUES
(1,	0,	1,	'Impulsa, promueve y lidera la interacción diaria entre los miembros del equipo, fijando claramente los objetivos y propiciando espacios periódicos de retroalimentación.'),
(2,	0,	1,	'Inspira al equipo con sus ideas y ejemplo, motivándolos a compartirlas para exceder juntos los resultados y cumplir con las políticas de la compañía.'),
(3,	0,	1,	'Reconoce de manera objetiva y permanente los logros de su equipo y las de cada uno de sus integrantes de manera abierta y pública.'),
(4,	0,	1,	'Moviliza al equipo y a toda la compañía con su actitud, entusiasmo y compromiso para cumplir con el propósito y la misión de la organización.'),
(5,	0,	1,	'Gestiona asertivamente el desempeño y desarrollo de los miembros del equipo, ofreciendo retroalimentación objetiva y frecuente, buscando liberar su talento e impulsar que alcancen sus objetivos.'),
(6,	1,	1,	'Impulsa, alienta y apoya a sus compañeros para cumplir con los objetivos y las tareas y busca retroalimentación cuando es necesario.'),
(7,	1,	1,	'Es un referente en el equipo por su ejemplo, por el cumplimiento de los resultados, los compromisos y las políticas de la compañía.'),
(8,	1,	1,	'Reconoce de manera espontánea y transparente cuando sus compañeros realizan un buen trabajo y los anima a hacer lo mismo con los demás equipos.'),
(9,	1,	1,	'Muestra una actitud positiva permanente que contagia a sus compañeros de entusiasmo y motivación.'),
(10,	1,	1,	'Tiene claro el propósito de la compañía y su rol dentro de ella para cumplirlo en todo lo que hace.'),
(11,	0,	2,	'Escucha de manera atenta y respetuosa las instrucciones, comentarios y recomendaciones de sus pares, clientes y jefe inmediato'),
(12,	0,	2,	'Utiliza el lenguaje adecuado y ajusta su estilo de comunicación, de acuerdo con las personas a las que se dirige, primando siempre las buenas costumbres y el respeto por la diferencia'),
(13,	0,	2,	'Tiene buena disposición en las conversaciones, validando lo entendido y manejando las discusiones con altura y responsabilidad'),
(14,	0,	2,	'Promueve el intercambio permanente de información, tanto en su equipo de trabajo como con otros niveles de la organización, con el propósito de mantener a todas las personas enteradas acerca de los temas que los involucran.'),
(15,	0,	2,	'Utiliza de manera correcta y oportuna los canales formales indicados por la compañía y ayuda a generar redes de contacto, evitando los rumores y la informalidad en la comunicación.'),
(16,	1,	2,	'Escucha de manera atenta y respetuosa las instrucciones y recomendaciones para efectuar su trabajo, validando su entendimiento y expectativas.'),
(17,	1,	2,	'Es cuidadoso en el manejo del lenguaje, evitando el uso de palabras disonantes o fuera de contexto en la relación con sus compañeros.'),
(18,	1,	2,	'Evita la confrontación con sus compañeros, superiores y clientes, propiciando espacios de entendimiento y solución a las circunstancias.'),
(19,	1,	2,	'Es inquieto en buscar y compartir información relevante para un mejor desempeño personal y de su equipo.'),
(20,	1,	2,	'Hace un uso apropiado de los canales indicados por la compañía, dando ejemplo a sus compañeros y evitando los rumores y malos comentarios.'),
(21,	0,	3,	'Participa activamente en las actividades del equipo y de la compañía, aportando con sus ideas y acciones al logro de los objetivos.'),
(22,	0,	3,	'Se hace cargo de sus funciones y responsabilidades buscando con ello facilitar y apoyar el trabajo del equipo, sin interferir inadecuadamente en el desarrollo del mismo o de otros en la organización.'),
(23,	0,	3,	'Respeta, valora y toma en cuenta las opiniones y recomendaciones de su equipo, compañeros y jefes y reconoce los aportes de los demás al logro de los objetivos'),
(24,	0,	3,	'Mantiene una actitud y disposición permanente al aprendizaje y al desarrollo de nuevas habilidades y competencias, así como a apoyar a su equipo en el desarrollo de las suyas'),
(25,	0,	3,	'Busca resolver los conflictos de manera asertiva, propiciando con ello un ambiente laboral armónico y tranquilo al interior del equipo y en la compañía'),
(26,	1,	3,	'Participa de manera activa en las actividades del equipo y de la compañía, aportando ideas y buscando alcanzar los resultados propuestos.'),
(27,	1,	3,	'Ejecuta de manera oportuna sus funciones para facilitar el trabajo del equipo y prestar así un mejor servicio.'),
(28,	1,	3,	'Escucha y tiene en cuenta las recomendaciones de sus superiores y compañeros y reconoce cuando los demás hacen un buen trabajo.'),
(29,	1,	3,	'Busca mejorar y crecer en la organización, mediante al auto aprendizaje y la participación en los procesos de formación y desarrollo de la compañía.'),
(30,	1,	3,	'Facilita la solución de los conflictos al interior del equipo, evitando que surjan y manteniendo un buen ambiente y armonía en el equipo.'),
(31,	0,	4,	'Presenta soluciones innovadoras y creativas a los problemas cotidianos, buscando mejorar con ello los procesos de la compañía'),
(32,	0,	4,	'Ante las amenazas y debilidades de los procesos, plantea soluciones prácticas y novedosas, adelantándose a los problemas'),
(33,	0,	4,	'Es un referente al interior de la organización por su habilidad para encontrar alternativas viables y diferentes ante las situaciones que se presentan.'),
(34,	0,	4,	'Participa activamente en los proyectos y sugiere otros nuevos para el mejoramiento de la organización'),
