(124,	73,	'Trabajo en equipo',	'Debe aportar al equipo de trabajo ideas innovadoras,   mejorar la comunicación con todos los miembros del equipo, generar aportes que den valor a su trabajo',	'Estar conectado con el equipo de trabajo aportando nuevas  ideas, buscando el cumplimiento de las metas generales y no solo individuales, mejorar las situaciones donde se presenten inconvenientes con los clientes, dar solución inmediata a sus reclamos o i',	'2020-08-06',	'',	'2020-06-02 19:45:45',	'2020-09-22 13:44:16',	'aceptado',	1),
(125,	74,	'procastinación',	'aplaza los tiempos de respuesta y situaciones que puede resolver de inmediato',	'trabajar en dar prioridad a temas inmediatos, utilizar herramientas  de programación de actividades, estar constantemente retroalimentando a las partes involucradas  en temas de necesidades urgentes y no urgentes',	'2020-08-18',	'',	'2020-06-03 00:22:05',	'2020-10-19 13:09:23',	'aceptado',	1),
(126,	75,	'Mayor conocimiento de la demanda de productos',	'falta conocimiento de mercado',	'realizar investigaciones  de mercado con los mismos clientes  y con el entorno, de las necesidades puntuales de producto',	'2020-08-20',	'',	'2020-06-03 14:28:27',	'2020-11-18 21:15:16',	'aceptado',	1),
(127,	76,	'Mejorar  trabajo de presión  con los clientes en temas de Gestión cartera',	'ser mas fuerte y agresivo con los clientes al momento de realizar la gestión de cobro no ser tan condescendiente',	'Realizar llamadas diarias y buscar el resultado positivo en la gestion de cobro,\npresionar el pago de una manera respetuosa pero eficiente y viendo resultados claros',	'2020-08-18',	'',	'2020-06-03 15:45:36',	'2020-09-22 16:03:33',	'aceptado',	1),
(128,	77,	'Bajo rendimiento en venta de lubricantes',	'cumplimiento de presupuesto de linea lubricantes',	'se debe realizar un estudio de mercado en producto de lubricantes en la zona, buscar  clientes potenciales interesados , posicionar la marca con publicidad, revisar los beneficios y atributos del producto',	'2020-08-21',	'',	'2020-06-03 22:07:00',	'2020-11-18 21:20:39',	'aceptado',	1),
